ROM Tests | <a href="{{URL::to('/examsother/'.$data->id) }}">Other Tests</a> | <a href="{{URL::to('/examsposture/'.$data->id) }}">Posture</a> | <a href="{{URL::to('/examsall/'.$data->id) }}">All Exams</a> | <a href="{{URL::to('/document/'.$data->id) }}">Documents</a><br><br><script>
function allnormal(key,test,normal){
	if(test==null){
		var i=0;
		while(document.getElementById(key+i+'observed')!=null){
			document.getElementById(key+i+'observed').value=document.getElementById(key+i+'normal').value;
			document.getElementById(key+i+'notes').value='Not restricted';
			setdifference(0,key,i);
			i++;
		}
	}
	else{ document.getElementById(key+test+'observed').value=normal;
		document.getElementById(key+test+'notes').value='Not restricted';
	}
	setdifference(0,key,test);
}
function setdifference(difference,key,test){
	if(difference<0) difference*=-1;
	var notes=document.getElementById(key+test+'notes');
	if(difference==0) notes.value='Not restricted'; else if(difference>0&&difference<=10) notes.value='Slightly restricted';
	else if(difference>10&&difference<=20) notes.value='Mildly restricted'; else if(difference>20&&difference<=30) notes.value='Moderately restricted';
	else if(difference>30) notes.value='Severely restricted';
	setpain(key,test);
}
function autoincrement(key,pm,test,normal){
	if(test==null){
		var i=0;
		while(document.getElementById(key+i+'observed')!=null){
			var autoinc=parseInt(document.getElementById('allautoincrement'+key).value);
			if(pm=='minus') autoinc*=-1;
			var obsval=document.getElementById(key+i+'observed').value;
			if(obsval=='') obsval=document.getElementById(key+i+'normal').value;
			var newval=parseInt(obsval)+autoinc;
			if(newval<0) newval=0;
			document.getElementById(key+i+'observed').value=newval;
			difference=newval-parseInt(document.getElementById(key+i+'normal').value);
			setdifference(difference,key,i);
			i++;
		}
	}
	else{
		var autoinc=parseInt(document.getElementById('autoincrement'+key+test).value);
		if(pm=='minus') autoinc*=-1;
		var obsval=document.getElementById(key+test+'observed').value;
		if(obsval=='') obsval=document.getElementById(key+test+'normal').value;
		var newval=parseInt(obsval)+autoinc;
		if(newval<0) newval=0;
		document.getElementById(key+test+'observed').value=newval;
		difference=newval-parseInt(document.getElementById(key+test+'normal').value);
		setdifference(difference,key,test);
	}
}
function pm(key,pm,test,normal){
	var obs=document.getElementById(key+test+'observed').value;
	if(obs=='') obs=parseInt(normal); else obs=parseInt(obs);
	if(pm=='plus') obs++; if(pm=='minus') obs--;
	document.getElementById(key+test+'observed').value=obs;
}
function setnotes(key,i){
	var notes=document.getElementById(key+i+'notes');
	var newval=document.getElementById(key+i+'noteselect').value;
	if(notes.value!=''&&newval!='with Pain'&&newval!='without Pain'&&newval!='') notes.value+=', ';
	else if(notes.value!='') notes.value+=' ';
	notes.value+=newval;
	document.getElementById(key+i+'noteselect').value='';
}
function clearnotes(key,i){
	var notes=document.getElementById(key+i+'notes');
	notes.value='';
	document.getElementById(key+i+'noteselect').value='';
}
function setpain(key,i){
	var painint=document.getElementById(key+i+'painint');
	if(painint.value=='0')
	document.getElementById(key+i+'noteselect').value='without Pain';
	else if(painint.value!='')
	document.getElementById(key+i+'noteselect').value='with Pain';
	document.getElementById(key+i+'notes').value=document.getElementById(key+i+'notes').value.replace(' with Pain','');
	document.getElementById(key+i+'notes').value=document.getElementById(key+i+'notes').value.replace(' without Pain','');
	setnotes(key,i);
